import React, {memo} from 'react';
import styled from 'styled-components';

const FooterContainer = styled.div`
    background-color: #f7f7f7;
    height:480px;
    padding:60px 80px;

    .footerInner{
      background-color: #00f5;
      width:100%;
      height:100px;
    }
`;

const Footer = memo(() => {
  return (
    <FooterContainer>
      <div className='footerInner'>

      </div>
    </FooterContainer>
  );
});

export default Footer;
